import Heading from "./Heading";
import List from "./List";
import {add,sub,mul,div} from './Calculator';

function App() {
	return(
		<div>
			<Heading/>
			<List/>
			<hr/>
			<ul>
				<li>{add(1,2)}</li>
				<li>{sub(3,2)}</li>
				<li>{mul(2,2)}</li>
				<li>{div(3,2)}</li>
			</ul>
		</div>
	)
}

export default App;
